export default (function(a,b,c,d,e,f,g,h,i){return {data:{BUctvhwNoE:{data:{id:1398,attributes:{imdbId:"tt0043625",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMzRjMWNiMDYtODdiMi00NDI2LTk4ZTctZjE1NDA3NTU0NTNiXkEyXkFqcGdeQXVyMDI2NDg0NQ@@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"7.0\u002F10"},{Source:"Rotten Tomatoes",Value:"86%"}],item_lang:{data:{id:2061,attributes:{title:d,plot:"The uptight and dumb small time thief Nick Robey and his partner and only friend Al Molin steal $10,000.00 from a man, but the heist goes wrong. Al Molin is killed by a policeman and Nick shoots him in the spine. He hides out in a public swimming pool and meets the lonely spinster Peggy Dobbs in the water. Nick uses Peggy to lie low. He offers a ride in a taxi to her and she invites him to her apartment, where she introduces her family to him. When Nick discovers that he killed the cop, he decides to use Peggy's apartment as hideout to wait the police manhunt cool down. When Nick finds that Peggy loves him, he invites her to leave town with him and asks her to buy a used car. However, Nick cannot trust anybody and believes Peggy has betrayed him.",slug:"he-ran-all-the-way"}}},books:{data:[{id:1049,attributes:{title:d,description:a,thumbnail:a,authors:[b],firstBook:true,published:"1947-01-01",publisher:a,subtitle:a}},{id:1050,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:i,subtitle:a}},{id:1051,attributes:{title:"The Sidewalks are Free",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=O-lJAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"1950-01-01",publisher:a,subtitle:a}},{id:1052,attributes:{title:"Windy City",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=n7l4BxB7PlwC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:["Ross, P.",b],firstBook:c,published:"1980-10-01",publisher:"Ballantine Books",subtitle:a}},{id:1053,attributes:{title:e,description:f,thumbnail:g,authors:[b],firstBook:c,published:h,publisher:i,subtitle:a}}]}}},meta:{}}},prerenderedAt:1680940980849}}("","Sam Ross",null,"He Ran All the Way","Melov's Legacy","Sam Ross’s novel is presented through the eyes of young Hershel Melov, the only child of an Eastern European immigrant family living in Chicago at the close of World War I. There are two legacies working at odds within the family; one is their old-world Ukranian heritage, and the other comes in the form of an insurance bequest which his father receives after Hershel’s uncle is killed while fighting in Europe. The money has a disastrous effect upon the family who prove inept players in the American “success” game.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LdBNCwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2016-01-19","Open Road Media"))